/*Table structure for table `navigation` */

DROP TABLE IF EXISTS `navigation`;

CREATE TABLE `navigation` (
  `id` tinyint(3) NOT NULL AUTO_INCREMENT,
  `name` varchar(250) NOT NULL COMMENT 'Name des Controller für die Navigation',
  `rolle_id` tinyint(3) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `rolle_id` (`rolle_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

/*Data for the table `navigation` */

insert  into `navigation`(`id`,`name`,`rolle_id`) values (1,'session',7),(2,'mail',7),(3,'spot',7);

/*Table structure for table `posts` */

DROP TABLE IF EXISTS `posts`;

CREATE TABLE `posts` (
  `id` int(5) NOT NULL AUTO_INCREMENT,
  `title` varchar(250) NOT NULL,
  `body` text NOT NULL,
  `status` int(5) DEFAULT '0',
  `author_id` int(5) NOT NULL,
  `date_create` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `posts` */

/*Table structure for table `rollen` */

DROP TABLE IF EXISTS `rollen`;

CREATE TABLE `rollen` (
  `id` tinyint(3) NOT NULL AUTO_INCREMENT,
  `bezeichnung` varchar(250) NOT NULL COMMENT 'Name der Rolle',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

/*Data for the table `rollen` */

insert  into `rollen`(`id`,`bezeichnung`) values (1,'besucher'),(2,'angemeldet'),(3,'kunde'),(4,'koordinator'),(5,'anbieter'),(6,'redakteur'),(7,'administrator');

/*Table structure for table `tags` */

DROP TABLE IF EXISTS `tags`;

CREATE TABLE `tags` (
  `id` int(5) NOT NULL AUTO_INCREMENT,
  `name` varchar(250) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `tags` */

/*Table structure for table `test` */

DROP TABLE IF EXISTS `test`;

CREATE TABLE `test` (
  `id` int(5) NOT NULL AUTO_INCREMENT,
  `name` varchar(250) NOT NULL,
  `zahl` int(5) DEFAULT NULL,
  `author_id` tinyint(3) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `test_ibfk_1` (`author_id`),
  CONSTRAINT `test_ibfk_1` FOREIGN KEY (`author_id`) REFERENCES `author` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

